import React from 'react';
import ReactDOM from 'react-dom';
import SeasonDisplay from 'SeasonDisplay';
const App = () => {
	return (
		<div>
			<h1>Hi Kieran</h1>
			<SeasonDisplay />
		</div>
	);
};

ReactDOM.render(
	<App />,
	document.querySelector('#root')
);
